import React, {useState} from 'react';
import {  Route, Routes } from 'react-router-dom';

import Home from "./Home";
import About from "./About";
import Cols from "./Cols";
import Account from "./Account";
import Navbar from "./Navbar"
import TesterApp from "./TesterSearchBar";
import BookDetails from "./BookDetails";
import TesterResultsList from "./TesterResultsList"
import Tester from "./Tester"

import "./Navbar.css";
import "./body.css";

const Body = () => {


  const [results, setResults] = useState([]);
  const [sorted, setSorted] = useState([]);

  return (
    <div className="body">


    <Navbar  setResults={setResults} sort={sort}/>
    

    <Routes>
    <Route path="/" element={<Home />} />
    <Route path="/about" element={<About />}/>
    <Route path="/collection" element={<Cols results={results} sort={sorted} setSort={setSort}/>}/>  
    <Route path="/account" element={<Account />}/>  
    <Route path="/book/:id" element={<BookDetails />}/>  

    <Route path="/testerapp" element={<TesterApp />}/>  
    <Route path="/bar" element={<TesterResultsList results={results}  />}/>  
    <Route path="/tester" element={<Tester />}/>  


   
    </Routes>

    </div>

    )
}

export default Body
